INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24015, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 110501, 24, "2019/07/31 12:00:00", 0.0, 4, 0.0, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 1);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24016, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 1, 110501, 24, "2019/07/31 12:00:00", 0.0, 4, 4.0, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 2);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24017, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 110501, 24, "2019/07/31 12:00:00", 0.0, 4, 0.0, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 3);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24018, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 2, 110501, 24, "2019/07/31 12:00:00", 0.0, 1, 5.2, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 4);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24019, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 6, 110501, 24, "2019/07/31 12:00:00", 0.0, 5, 4.2, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 5);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24020, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 110501, 24, "2019/07/31 12:00:00", 0.0, 2, 0.0, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 6);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24021, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 6, 110501, 24, "2019/07/31 12:00:00", 0.0, 1, 6.4, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 7);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24022, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 110501, 24, "2019/07/31 12:00:00", 0.0, 2, 0.0, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 8);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24023, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 3, 110501, 24, "2019/07/31 12:00:00", 0.0, 6, 10.08, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 9);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24024, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 2, 110501, 24, "2019/07/31 12:00:00", 0.0, 1, 5.0, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 10);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24025, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 110501, 24, "2019/07/31 12:00:00", 0.0, 2, 0.0, 10021, "カオリ（サマー）", "2030/12/17 14:59:59", 0.0, 11);
